check=1

warehouse = {}
maketeam()
ini_change("tobot_scriptbot",1)
ini_change("tobot_script_x_distance",100)
bot_start()

local function isInMap()
	if getmapid()==58500
	or getmapid()==58501
	or getmapid()==58502
	or getmapid()==58503
	or getmapid()==58504
	or getmapid()==58505
	or getmapid()==28600  then
		return true
	end
	return false
end

local function isNumEnd()
	if indun_get(186) == 15.0 then 
		printgame(0,255,255,"No more chance.")
		return true
	end
	return false
end

function warehouse.begin()
	bot_stop()
    sleep(5000)

	if isNumEnd() then
		speak("END")
		bot_stop()
		return
	end

	
	if not isInMap() then
		plane(186)
	end
	
	while(true)
	do
		mapid_now = getmapid()
		if mapid_now ~= mapid_last then
			mapid_last = mapid_now
			if(getmapid()==28600)then
				plane(186)
				if isNumEnd() then
					sleep(2000)
					bot_stop()
					return
				end
				script_txt_loaddata("", 1)
				bot_start()
			end
			
			if(getmapid()==58500)then
				script_txt_loaddata("",0)
			end
			
			if(getmapid()==58501)then
				script_txt_loaddata("",0)
			end
				
			if(getmapid()==58502)then
				script_txt_loaddata("",0)
			end
			
			if(getmapid()==58503)then
				script_txt_loaddata("",0)
			end
			
			if(getmapid()==58504)then
				script_txt_loaddata("",0)
			end
				
			if(getmapid()==58505)then
				script_txt_loaddata("",0)
			end

		end
	end
end

warehouse.begin()

return warehouse


